SELECT ?office ?mayorOffice WHERE {
  dbr:Mehmet_Naci_Bostancı dbo:office ?office .
  ?mayor dbo:birthPlace dbr:Turkey ;
         dbo:politician ?politician ;
         dbo:party dbr:Nation_Alliance_(Turkey) ;
         dbo:office ?mayorOffice .
  FILTER(?politician = dbr:Mehmet_Naci_Bostancı)
}

SELECT ?militaryForce WHERE {
  ?event a dbo:Event ;
         dbo:militaryConflict ?militaryConflict ;
         dbo:societalEvent ?societalEvent ;
         dbo:person dbr:Francisco_Largo_Caballero .
  ?militaryConflict dbo:militaryForce ?militaryForce .
}

